"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Intussusception (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/intussusception-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H7191772\">",
"      <span class=\"h1\">",
"       What is intussusception?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Intussusception is a condition that can cause severe belly pain. It happens when 1 part of the intestine slides into another part of the intestine. Intussusception can happen with either the small or large intestine (",
"      <a class=\"graphic graphic_figure graphicRef66110 \" href=\"mobipreview.htm?28/27/29107\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      When 1 part of the intestine slides into another, it causes a blockage. When the intestine is blocked, air, fluid, and food get stuck. They can&rsquo;t move through the intestine the way they normally would. This causes symptoms.",
"     </p>",
"     <p>",
"      Intussusception happens most often in children, especially in children younger than 3 years old. In some cases, intussusception is caused by another medical condition. But in most cases, doctors don&rsquo;t know what caused the intussusception.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7191787\">",
"      <span class=\"h1\">",
"       What are the symptoms of an intussusception?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms usually start suddenly and can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Severe belly pain &ndash; The pain comes in waves. At first, episodes of pain happen about every 15 to 20 minutes, but the episodes get closer over time. The pain usually makes children cry and pull their knees up into their belly.",
"       </li>",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Bloody bowel movements",
"       </li>",
"       <li>",
"        Being very sleepy and hard to wake up",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Although uncommon, some children with a small intussusception do not have any symptoms. Their doctor might see that they have an intussusception when the child has a test for another reason. Children who have no symptoms might not need treatment.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7191802\">",
"      <span class=\"h1\">",
"       Should my child see the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Call your child&rsquo;s doctor or nurse right away if your child has symptoms of an intussusception.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7191817\">",
"      <span class=\"h1\">",
"       Is there a test for an intussusception?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The doctor or nurse will ask about your child&rsquo;s symptoms and do an exam. He or she will do an imaging test of the belly, such as an X-ray or ultrasound. Imaging tests create pictures of the inside of the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7191832\">",
"      <span class=\"h1\">",
"       How is an intussusception treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The doctor will do a few things to treat your child&rsquo;s intussusception.",
"     </p>",
"     <p>",
"      He or she will give your child fluids into his or her vein through a tube called an &ldquo;IV.&rdquo;",
"     </p>",
"     <p>",
"      He or she will also put a thin tube called a &ldquo;nasogastric tube&rdquo; in your child&rsquo;s nose, down the esophagus, and into the stomach. The tube will suck up the fluid and air in the stomach. This will make your child feel better and keep him or her from vomiting.",
"     </p>",
"     <p>",
"      After that, the doctor will fix the intussusception. There are different ways to do this. They include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A procedure called &ldquo;nonoperative reduction&rdquo; &ndash; This is not surgery. For this procedure, the doctor will put a tube into your child&rsquo;s rectum and push air or a special fluid into the tube. The air or fluid will go into the rectum and through the intestine. As the air or fluid reaches the intussusception, it makes the stuck intestine slide back out of the other part of the intestine. To follow what he or she is doing, the doctor will do an ultrasound or X-ray during this procedure.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Surgery &ndash; If the intussusception could not be fixed with the nonoperative reduction, or if the intussusception has caused problems, your child will probably need surgery.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7191847\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
