var title_f33_33_34331="Diagnosis of SCID";
var content_f33_33_34331=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F67948&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F67948&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=3\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for severe combined immunodeficiency (SCID)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Definitive diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Male or female patient less than 2 years of",
"age with either (a) engraftment of transplacentally acquired maternal T",
"cells or (b) less than 20 percent CD3+ T cells, an absolute lymphocyte",
"count of less than 3000/mm",
"        <sup>",
"         3",
"        </sup>",
"        , and at least one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Mutation in the cytokine common gamma chain (&Gamma;c).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Mutation in JAK3.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Mutation in RAG1 or RAG2.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Mutation in",
"IL-7R&alpha;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        5. ADA activity of less than 2 percent of control or mutations",
"in both alleles of ADA.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Probable diagnosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Male or female patient less than 2 years of age with (a) less than",
"20 percent CD3+ T cells, an absolute lymphocyte count of less than",
"3000/mm",
"        <sup>",
"         3",
"        </sup>",
"        , and proliferative responses to mitogens less than 10 percent",
"of control or (b) the presence of maternal lymphocytes in the",
"circulation.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Patients with a definitive or probable diagnosis are assumed to have a greater than 98 and 85 percent probability, respectively, that in 20 years they will still have the same diagnosis.",
"    </div>",
"    <div class=\"reference\">",
"     From Conley, ME, Notarangelo, LD, Etzioni, A. Clin Immunol 1999; 93:190.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
